import React from 'react';
import { Layout, Menu, Button, Input, List } from 'antd';
import './App.css';
import { columns } from './components/columns'

const { Header, Content, Footer } = Layout;
const ballotColumns = columns.ballotColumns;

class App extends React.Component {

  constructor (props) {
    super(props);
  }

  getBallotItem () {

  }

  render() {
    return (
      <Layout className="layout">
        <Header style={{ padding: '0 15%' }}>
          <div className="logo" />
          <Menu
            theme="dark"
            mode="horizontal"
            defaultSelectedKeys={['1']}
            style={{ lineHeight: '64px'}}
          >
            <Menu.Item key="1" style={{ marginLeft: '0%' }} >All</Menu.Item>
            <Menu.Item key="2">Active</Menu.Item>
            <Menu.Item key="3">To Finalize</Menu.Item>
          </Menu>
          <Button style={{ marginLeft: '3%' }}>New Ballot</Button>
        </Header>

        <Content style={{ padding: '0 15%' }}>
          <div id='searchDiv'>
            <Input.Search
              placeholder="input search text"
              onSearch={value => console.log(value)}
              enterButton
            />
          </div>
          <h1 style={{ padding: '2% 0 0 0' }} > All </h1>
          <div style={{ background: '#fff', padding: 24, minHeight: 600 }}>
            <List
              grid = {{ gutter: 27, column: 6}}
              dataSource = {ballotColumns}
              renderItem = { item => (
                <List.Item>
                  <div>
                    <h3>{item.title}</h3>
                    <p>{item.key}</p>
                  </div>
                </List.Item>
              )}
            />
            <hr></hr>
          </div>
        </Content>

        <Footer style={{ textAlign: 'center'}}>
          Ant Design ©2018 Created by Ant UED
        </Footer>
      </Layout>
    )
  }
}

export default App;
